import Product from "../product/Product";
import "./pplist.css";
import { productData } from "../../productData";



const Prolist =()=>{
  const allProducts = productData.map(photo=> {
  return (
    <Product
      key={photo.id}
      img={`../../productimgs/${image}`}
      link={photo.link}
      title={photo.title}
    />
  )
})

  return(
    <div className="pl">
      <div className="pl-text">
        <h1 className="pl-tittle"> Keep Coding </h1>
        <p className="pl-desc"> Here is the work I did during the bootcamp and later
        during my independent study. You can see my progress!</p>
      </div>

      <div className="pl-list">
        {allProducts}
      </div>
    </div>

  )
}

export default Prolist
